description:
Verenigde Staten
Drama / Thriller
87 minuten

goed

met Emily Browning, David Strathairn en Elizabeth Banks

Nadat haar moeder is overleden, zit Anna Rydell (Emily Browning) tijdelijk in een tehuis voor geesteszieken. Als ze weer thuis 
komt treft ze daar een levende nachtmerrie aan. Haar vader (David Strathairn) blijkt samen te leven met de voormalige 
verpleegster (Elizabeth Banks) van zijn vorige vrouw. Als Anna dan op een nacht bezoek krijgt van een geest die haar attent 
maakt op de slechte intenties van haar stiefmoeder, besluit Anna samen met haar zus een einde aan de relatie te maken.
